
module.exports = f;


function f() {
  return f;
}
f.error = error;
f.info  = info;
f.warn  = warn;
f.fatal = fatal;
f.trace = trace;
f.debug = debug;


function error() {
  console.error(arguments);
}


function info() {
  console.info(arguments);
}


function warn() {
  console.warn(arguments);
}


function debug() {
  console.debug(arguments);
}


function fatal() {
  console.fatal(arguments);
}


function trace() {
  console.trace(arguments);
}